import './Article.css';
import {ReactComponent as Umbrella} from './umbrella.svg';

function Article(id, title, autor, category, publication_date, icon) {
  return (
    <a href='article.html?id = {id}'>
        <article>
            <h3>My title
                <span>Bar caz <time>2024-01-26</time></span>
                <p>Nature</p>
                <Umbrella/>
            </h3>
        </article>
    </a>
  );
}

export default Article;
